import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import InfluencePage from './pages/InfluencePage';
import TrajectoryPage from './pages/TrajectoryPage';
import CitationPage from './pages/CitationPage';
import AuthorPage from './pages/AuthorPage';
import CitationYearPage  from './pages/CitationYearPage';
import './App.css'; // css는 외부 파일로 빼자

function App() {
  return (
    <Router>
      <div>
        <div className="navbar">
          <Link className="nav-item" to="/">Influence</Link>
          <Link className="nav-item" to="/trajectory">Trajectory</Link>
          <Link className="nav-item" to="/citation">Citation</Link>
          <Link className="nav-item" to="/author">Author</Link>
          <Link className="nav-item" to="/citation-year">Citation-Year</Link>
          <Link className="nav-item" to="/author-year">Year</Link>
        </div>

        <div className="dashboard-container">
          <h1>NLP Influence Dashboard</h1>

          <Routes>
            <Route path="/" element={<InfluencePage />} />
            <Route path="/trajectory" element={<TrajectoryPage />} />
            <Route path="/citation" element={<CitationPage />} />
            <Route path="/author" element={<AuthorPage />} />
            <Route path="/citation-year" element={<CitationYearPage />} />
            <Route path="/author-year" element={<AuthorYearPage />} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
